using CryptoBase.Abstractions.SymmetricCryptos;
using CryptoBase.BouncyCastle.SymmetricCryptos.StreamCryptos;
using CryptoBase.DataFormatExtensions;
using CryptoBase.SymmetricCryptos.StreamCryptos;
using CryptoBase.SymmetricCryptos.StreamCryptos.ChaCha20Original;

namespace CryptoBase.Tests;

[TestClass]
public class ChaCha20OriginalTest
{
	private static void Test(SnuffleCryptoBase crypto, string inputHex, string outputHex)
	{
		Assert.AreEqual(@"ChaCha20Original", crypto.Name);
		Assert.AreEqual(8, crypto.IvSize);

		Span<byte> i = inputHex.FromHex();
		Span<byte> o = outputHex.FromHex();
		Span<byte> o1 = stackalloc byte[i.Length];

		crypto.Update(i, o1);
		Assert.IsTrue(o1.SequenceEqual(o));

		crypto.Reset();

		crypto.Update(i, o1);
		Assert.IsTrue(o1.SequenceEqual(o));

		crypto.Dispose();
	}

	private static void Test(SnuffleCryptoBase crypto, string outputHex)
	{
		Assert.AreEqual(@"ChaCha20Original", crypto.Name);
		Assert.AreEqual(8, crypto.IvSize);

		Span<byte> h = outputHex.FromHex(); // 65536

		Span<byte> i = stackalloc byte[512];
		Span<byte> o1 = stackalloc byte[512];

		// 63
		for (var j = 0; j < 1040; j++)
		{
			crypto.Update(i[..63], o1);
			Assert.IsTrue(o1[..63].SequenceEqual(h.Slice(63 * j, 63)));
		}

		crypto.Update(i[..63], o1);
		Assert.IsTrue(o1[..16].SequenceEqual(h.Slice(63 * 1040, 16)));

		crypto.Reset();

		// 64
		for (var j = 0; j < 1024; j++)
		{
			crypto.Update(i[..64], o1);
			Assert.IsTrue(o1[..64].SequenceEqual(h.Slice(64 * j, 64)));
		}

		crypto.Reset();

		// 128
		for (var j = 0; j < 512; j++)
		{
			crypto.Update(i[..128], o1);
			Assert.IsTrue(o1[..128].SequenceEqual(h.Slice(128 * j, 128)));
		}

		crypto.Reset();

		// 256
		for (var j = 0; j < 256; j++)
		{
			crypto.Update(i[..256], o1);
			Assert.IsTrue(o1[..256].SequenceEqual(h.Slice(256 * j, 256)));
		}

		crypto.Reset();

		// 512
		for (var j = 0; j < 128; j++)
		{
			crypto.Update(i[..512], o1);
			Assert.IsTrue(o1[..512].SequenceEqual(h.Slice(512 * j, 512)));
		}

		crypto.Dispose();
	}

	[TestMethod]
	[DataRow(@"1C9240A5EB55D38AF333888604F6B5F0473917C1402B80099DCA5CBC207075C0",
		@"1F86ED54BB2289F0",
		@"",
		@"")]
	public void Test(string keyHex, string ivHex, string hex, string hex2)
	{
		var key = keyHex.FromHex();
		var iv = ivHex.FromHex();
		Test(new BcChaCha20OriginalCrypto(key, iv), hex, hex2);
		Test(new ChaCha20OriginalCryptoSF(key, iv), hex, hex2);
		Test(new ChaCha20OriginalCryptoX86(key, iv), hex, hex2);
		Test(StreamCryptoCreate.ChaCha20Original(key, iv), hex, hex2);
	}

	[TestMethod]
	[DataRow(@"0A5DB00356A9FC4FA2F5489BEE4194E73A8DE03386D92C7FD22578CB1E71C417",
		@"1F86ED54BB2289F0",
		@"")]
	[DataRow(@"3A8DE03386D92C7FD22578CB1E71C417",
		@"1F86ED54BB2289F0",
		@"")]
	[DataRow(@"1C9240A5EB55D38AF333888604F6B5F0473917C1402B80099DCA5CBC207075C0",
		@"1C00000000000000",
		@"")]
	public void Test65536(string keyHex, string ivHex, string hex)
	{
		var key = keyHex.FromHex();
		var iv = ivHex.FromHex();
		Test(new BcChaCha20OriginalCrypto(key, iv), hex);
		Test(new ChaCha20OriginalCryptoSF(key, iv), hex);
		Test(new ChaCha20OriginalCryptoX86(key, iv), hex);
		Test(StreamCryptoCreate.ChaCha20Original(key, iv), hex);
	}
}
